import React from "react";
import { BrowserRouter, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Route path="/badges" component={Badges} />
      <Route path="/badges/new" component={BadgeNew} />
    </BrowserRouter>
  );
}

export default App;
